import React from 'react';
import {Container} from 'react-bootstrap'

const MesVoitures = (props) => {
    const {VoitureLuxe} = props
    return (
        <Container>
            <div className="divMesVoitures">
                 <img src={VoitureLuxe.image.url} className="imageLuxe"/>
                 <div style={{display:'flex'}}>
                    <div>
                         <p> Marque: {VoitureLuxe.marque} </p>
                         <p> MesVoitures: {VoitureLuxe.marque} </p>
                    </div>

                    <div style={{marginLeft:20, marginTop:20}}>
                        <a className="voirPlus"> Voir Plus</a>
                    </div>
                 </div>
            </div>
        </Container>
    );
};

export default MesVoitures;
